import React from "react";
import { Container, Row } from "react-bootstrap";

import Card from '../components/Card'

import Fisico1 from '../img/fisico1.png';
import Digital1 from '../img/digital1.png';

export default Index => {
    return (
        <div style={{ display: 'flex', justifyContent: 'space-between', padding: '20px' }}>
            <Row>
                <Card Titulo='Convite de casamento' Texto='R$ 3,00 Un.' Img={Fisico1} />
                <Card Titulo='teste' Texto='teste' Img={Fisico1} />
                <Card Titulo='teste' Texto='teste' Img={Digital1} />
            </Row>
        </div>
    );
}
